window.requestFrame = (function() {
    return window.requestAnimationFrame      ||
           window.webkitRequestAnimationFrame||
           window.mozRequestAnimationFrame   ||
           window.oRequestAnimationFrame     ||
           window.msRequestAnimationFrame    ||
           function(callback) {window.setTimeout(callback, 1000/60)}
})()

function rgb(r,g,b) {
    r = ~~(r*255)
    g = ~~(g*255)
    b = ~~(b*255)
    return '#' + 
        (r>0xf?'':'0')+r.toString(16) +
        (g>0xf?'':'0')+g.toString(16) +
        (b>0xf?'':'0')+b.toString(16)
}

function ryb(r,y,b) {
    var w = Math.min(r,y,b)
    r -= w
    y -= w
    b -= w
    
    var max = Math.max(r,y,b)
    var g  = Math.min(y,b)
    y -= g
    b -= g
    
    if (b && g) {
        b *= 2
        g *= 2
    }

    r += y
    g += y

    var n = Math.max(r,g,b)
    if (n) {
        n = max/n
        r *= n
        g *= n
        b *= n
    }

    return rgb(r+w,g+w,b+w)    
}

function hue(h,s,v) {
    if (!v) v = s?s:0.97
    if (!s) s = 1

    var c = v*s
    var x = c*(1-Math.abs((h/=60)%2-1))
    var m = v-c

    switch (~~h) {
        case 0: return ryb(c+m,x+m,m)
        case 1: return ryb(x+m,c+m,m)
        case 2: return ryb(m,c+m,x+m)
        case 3: return ryb(m,x+m,c+m)
        case 4: return ryb(x+m,m,c+m)
        case 5: return ryb(c+m,m,x+m)
    }
}

function hue2(h,s,v) {
    return hue((h+180)%360,s,v)
}

function raster(pix, pallet, psize, width, canvas) {
    if (!canvas) canvas = document.createElement('canvas')
    canvas.width = psize*width
    canvas.height = psize*pix.length/width
    var c = canvas.getContext('2d')
    
    for (var t=pix.length-1; t>0; t--) {
        var tc = pix[t]
        if (tc < 0) continue

        c.fillStyle = pallet[tc]
        c.fillRect((t%width)*psize, ~~(t/width)*psize, psize, psize)
    }

    return canvas
}

